        <style>
            body {
                margin: 0;
                font-family: "Chicle", serif;
                background: black;
                width: 100vw;
                height: 100vh;
                overflow: hidden;
            }

            #ori {
                width: 100%;
                height: 100%;
                line-height: 100vh;
                text-align: center;
                font-size: 25vh;
                letter-spacing: 20px;
                background: linear-gradient(90deg, rgba(99,57,15,1) 50%, rgba(64,192,255,1) 60%);
                background-clip: text;
                color: transparent;
            }

            .photo {
                position: absolute;
                bottom: 0;
                left: 50%;

                border: 10px solid white;
                border-bottom: 40px solid white;

            }

            .photo.left {
                animation: fadeleft 3s linear forwards;
            }
            .photo.right {
                animation: faderight 3s linear forwards;
            }

            @keyframes fadeleft {
                from {
                    transform: translate(-50%, -50%);
                    opacity: 1;
                }

                to {
                    transform: translate(-100%, -150%) rotate(-20deg);
                    opacity: 0;
                }
            }
            @keyframes faderight {
                from {
                    transform: translate(-50%, -50%);
                    opacity: 1;
                }

                to {
                    transform: translate(0, -150%) rotate(20deg);
                    opacity: 0;
                }
            }
        </style>

    <body>
        <div id="ori">ORI</div>
        <script>
            window.addEventListener("load", function() {
                function makeimg() {
                    let elem = document.createElement("img");
                    elem.src = urls[Math.floor(Math.random() * urls.length)];
                    elem.classList.add("photo");
                    elem.style.left = ((Math.random() * 80) + 10) + "%";
                    elem.style.display = "none";

                    elem.addEventListener("load", function() {
                        this.style.display = "block";
                        if(Math.random() < 0.5) this.classList.add("left");
                        else this.classList.add("right");
                    });

                    elem.addEventListener("animationend", function() {
                        document.body.removeChild(this);
                    })

                    document.body.appendChild(elem);
                }
                makeimg();
                setInterval(makeimg, 2500);
            });
        </script>
